webpackJsonp([0x7fbc89c417da],{691:function(A,e){A.exports={data:{markdownRemark:{headings:[{value:"Problem",depth:2},{value:"Solution",depth:2}],html:'<p>Form Check assists budding athletes to explore a variety of sports and practice them properly by demonstrating maneuvers and analyzing techniques. Ultimately providing a healthy pathway for athletes by reinforcing proper form and creates an efficient method to learn from.</p>\n<h2>Problem</h2>\n<p>There were 8.6 Million reported sports injury in 2011 to 2014. The most common injuries that occur in sports are sprains and strains. How could we lessen the seriousness of these injuries? </p>\n<p>Gary’s thesis project and his research included approaches to train the mental and physical aspects of athletes and how these techniques can be translated to other aspects. However, It resulted on causes that could be improved by improving mental and physical training. </p>\n<h2>Solution</h2>\n<p>To create an application that guides a safer and healthier pathway for athletes to explore different sports. Form Check supports a user to learn proper techniques to reduce the risk of injury from repetition and accidents through augmented reality tutorials and analyzing the user’s body through recorded videos. Proper form is the perfect foundation for athletes to improve exponentially at sports while reducing the intensity and chance of injury.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/formcheck_one-3f889dadb83ad1ff9b98827102b80006-53128.png"\n        srcset="/static/formcheck_one-3f889dadb83ad1ff9b98827102b80006-7266b.png 375w,\n/static/formcheck_one-3f889dadb83ad1ff9b98827102b80006-0a3c1.png 750w,\n/static/formcheck_one-3f889dadb83ad1ff9b98827102b80006-53128.png 1500w,\n/static/formcheck_one-3f889dadb83ad1ff9b98827102b80006-91640.png 2250w,\n/static/formcheck_one-3f889dadb83ad1ff9b98827102b80006-1955b.png 2560w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>These are the three main features to learn proper techniques.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/formcheck_two-0ea16cb55f6daeffa8dda9f705a87687-53128.png"\n        srcset="/static/formcheck_two-0ea16cb55f6daeffa8dda9f705a87687-7266b.png 375w,\n/static/formcheck_two-0ea16cb55f6daeffa8dda9f705a87687-0a3c1.png 750w,\n/static/formcheck_two-0ea16cb55f6daeffa8dda9f705a87687-53128.png 1500w,\n/static/formcheck_two-0ea16cb55f6daeffa8dda9f705a87687-91640.png 2250w,\n/static/formcheck_two-0ea16cb55f6daeffa8dda9f705a87687-1955b.png 2560w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p><strong>MARKETING WEBSITE</strong></p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 736px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 271.7391304347826%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/formcheck_website-106d5a82f444b450dc2405e21546df6c-9c8d5.jpg"\n        srcset="/static/formcheck_website-106d5a82f444b450dc2405e21546df6c-fd410.jpg 375w,\n/static/formcheck_website-106d5a82f444b450dc2405e21546df6c-9c8d5.jpg 736w"\n        sizes="(max-width: 736px) 100vw, 736px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Form check is still a work in progress … It might be up on Gary’s portfolio. Hopefully.</p>',frontmatter:{title:"Form Check",graduate:"Gary Fung",category:"Product Design",category2:"UI/UX",category3:null,image:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.5,src:"/static/formcheck_featurenew-c92d33bc98bd604cfde547eddb94c701-d961b.png",srcSet:"/static/formcheck_featurenew-c92d33bc98bd604cfde547eddb94c701-ea1f7.png 375w,\n/static/formcheck_featurenew-c92d33bc98bd604cfde547eddb94c701-e49c9.png 750w,\n/static/formcheck_featurenew-c92d33bc98bd604cfde547eddb94c701-d961b.png 1080w",sizes:"(max-width: 1080px) 100vw, 1080px"}}}}},projectsInCategory:{edges:[{node:{frontmatter:{title:"aegis",graduate:"Chloe Typert-Morrison"}}},{node:{frontmatter:{title:"Criket",graduate:"Alicia Lee"}}}]},projectByStudent:{edges:[{node:{frontmatter:{title:"Form Check",graduate:"Gary Fung"}}}]}},pathContext:{slug:"/work/form-check/",name:"/Form Check/",title:"Form Check",graduate:"/Gary Fung/",category:"/Product Design/"}}}});
